pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/utils/math/Math.sol";

import "hardhat/console.sol";


contract Knots is ERC721, Ownable, Pausable {

    uint16 MAX_KNOTS = 720;
    uint8 MAX_MINTS = 5;

    //uint MINT_PRICE = 27 * 10e16;
    uint MINT_PRICE = 27 * 10e12;

    mapping (address => bool) hasVoucher;
    uint16[] knotsAvailable = new uint16[](MAX_KNOTS);
    uint saleStartsAt;
    uint redeemStartsAt;
    string baseURI;

    address payable wurmWallet;
    address payable violetWallet;
    address payable nemesisWallet;
    address payable chrisWallet;
    address payable delugeWallet;

    uint wurmShare = 10;
    uint violetShare = 30;
    uint nemesisShare = 10;
    uint chrisShare = 10;

    constructor(
        string memory metadataBaseURI,
        address payable _wurmWallet,
        address payable _violetWallet,
        address payable _nemesisWallet,
        address payable _chrisWallet,
        address payable _delugeWallet,
        uint _saleStartsAt,
        uint _redeemStartsAt,
        address[] memory novelTokenHolders
    ) ERC721("KNOTS", "KNOT") {
        for(uint16 i; i < MAX_KNOTS; i++) {
            knotsAvailable[i] = i+1;
        }

        wurmWallet = _wurmWallet;
        violetWallet = _violetWallet;
        nemesisWallet = _nemesisWallet;
        chrisWallet = _chrisWallet;
        delugeWallet = _delugeWallet;

        saleStartsAt = _saleStartsAt;
        redeemStartsAt = _redeemStartsAt;

        for (uint16 i = 0; i < novelTokenHolders.length; i++) {
            hasVoucher[novelTokenHolders[i]] = true;
        }

        baseURI = metadataBaseURI;
    }

    function pickKnot(uint seed) internal returns (uint) {
        uint numKnots = knotsAvailable.length;
        uint index = seed % numKnots;

        uint knotId = knotsAvailable[index];

        knotsAvailable[index] = knotsAvailable[numKnots-1];
        knotsAvailable.pop();

        return knotId;
    }

    error WrongPrice(uint received, uint expected);

    function mint(address recipient, uint seed, uint numKnots) public payable whenNotPaused {
        require(numKnots > 0 && numKnots <= MAX_MINTS, "Knots: maximum mint count of 5 knots exceeded");

        if (hasVoucher[msg.sender]) {
            require(block.timestamp >= redeemStartsAt, "Knots: redeem window has not opened");
            uint price = (numKnots - 1)*MINT_PRICE;
            hasVoucher[msg.sender] = false;
            require(msg.value == (numKnots - 1)*MINT_PRICE, "Knots: invalid mint fee for novel token holder");
        } else {
            require(block.timestamp >= saleStartsAt, "Knots: sale has not started");
            require(msg.value == numKnots*MINT_PRICE, "Knots: redeem window has not not opened");
        }

        console.log("Num Knots requested: %s", numKnots);

        for (uint i = 0; i < numKnots; i++) {
            uint tokenId = pickKnot(seed);
            console.log("Minting token number: %s", tokenId);
            _mint(recipient, tokenId);
        }

        uint amount = msg.value;
        uint wurmReceives = amount * wurmShare / 100;
        uint violetReceives = amount * violetShare / 100;
        uint chrisReceives = amount * chrisShare / 100;
        uint nemesisReceives = amount * nemesisShare / 100;
        uint delugeReceives = amount - wurmReceives - violetReceives - chrisReceives - nemesisReceives;

        delugeWallet.transfer(delugeReceives);
        wurmWallet.transfer(wurmReceives);
        nemesisWallet.transfer(nemesisReceives);
        violetWallet.transfer(violetReceives);
        chrisWallet.transfer(chrisReceives);
    }

    function hasVouchers(address recipient) public view returns (bool) {
        return hasVoucher[recipient];
    }

    function updatePaused(bool _paused) public onlyOwner {
        if (_paused) {
            _pause();
        } else {
            _unpause();
        }
    }

    // TODO: DELETE THIS FUNCTION MAYBE?
    function updateBaseURI(string memory _baseURI) public onlyOwner {
        baseURI = _baseURI;
    }

    /**
     * @dev Base URI for computing {tokenURI}. If set, the resulting URI for each
     * token will be the concatenation of the `baseURI` and the `tokenId`. Empty
     * by default, can be overriden in child contracts.
     */
    function _baseURI() internal view virtual override returns (string memory) {
        return baseURI;
    }
}
